<style>
        
* {
    box-sizing: border-box;
    margin: 0;
    padding: 0;
  }
  
  header {    
    display: flex;
    justify-content: space-between;
    align-items: center; 
    padding: 15px 10%; 
    background-color: #EBF3F8;
    box-shadow: 0 4px 2px -2px gray;
  }
  

  .cta {
    padding: 7px 40px;
    background-color:rgba(183, 211, 227, 0.86);
    border: 2px solid #2C5A7C;
    border-radius: 2em;
    cursor: pointer;
    transition: background-color 0.3s ease 0s;
    color:#2C5A7C;
    margin-left: 30px;
    font-family: 'Roboto', sans-serif;
    font-weight: 400;
  }
  
  .cta:hover {
    background-color: rgba(0, 136, 169, 0.8);
  }
  
  .logo {
      margin-top: 5px;
      text-decoration: none;
      color: 3A7CA5;
      font-family:'Lucida Sans', 'Lucida Sans Regular', 'Lucida Grande', 'Lucida Sans Unicode', Geneva, Verdana, sans-serif;
  }

  a:hover {
    color: rgba(0, 136, 169, 1);
  }


  body {
      background-color: #81C3D7;
  }

  .right {
      float: right
  }
  
  .sell {
      text-decoration: underline;
      color: #2C5A7C;
  }
  .title {
      color: white;
      margin-top: 120px;
      font-size: 1.5em;
      font-family: 'Roboto', sans-serif;
      font-weight: 500;

  }

  .font {
    font-family: 'Roboto', sans-serif;
  }

  .center {
     display: flex;
     justify-content: center; 
  }


  .items-div {
      margin: 50px;
  }

  .button {
      width: 120px; 
      height: 120px;
      background-color: #E9F4FF;
      border-radius: 25px;
      margin: 1.5em;
      text-align: center;
      padding-top: 1.5em;
  }

  .description {
      color: white;
      text-align: center;
      font-family: 'Roboto', sans-serif;
      font-weight: 300;
  }

  .search {
      background-color: #EBF3F8;
      border-radius: 30px;
      display: block;
      margin-left: auto;
      margin-right: auto;
      width: 40%;
      height: 45px;
      padding-left: 10px;
  }

  .notifs {
      padding-left: 30px;
      margin-bottom: 10px;
  }

  .input {
      border: none;
      outline: none;
      background-color: #EBF3F8;
      width: 85%;
  }

  .panel 
  {
    height: 60%;
    width: 85%;
    display: block;
    margin-top: 10%;
    margin-left: auto;
    margin-right: auto;
  }

  .sell-container
  {
      margin-bottom: 0;
      float: left;
      margin-bottom: 0.5em;
  }

  .sell-choice 
  {
      color: white;
      font-size: 1.5em;
      margin-right: 1em;
      margin-left: 0.5em;
      font-weight: 400;
      letter-spacing: 1px;
      color: #EBF3F8;
      opacity: 0.5;
  }

  .service
  {
    font-weight: 600;
    opacity: 1;
  }

  svg 
  {
      margin-top: 0;
  }

</style>
